import React from "react";
import { useSelector } from "react-redux";

function Alert() {
  const { data } = useSelector((state) => {
    return state.alert;
  });
  return data.map((alert) => (
    <div key={alert.id} className={`alert alert-${alert.res.alertType}`}>
      {alert.res.msg} KKKK
    </div>
  ));
}

export default Alert;
